// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import Discover from './pages/Discover';
import TaskTracking from './pages/TaskTracking';
import SwipeProject from './pages/SwipeProject';
import Dashboard from './pages/Dashboard';
import SkillDevelopment from './pages/SkillDevelopment';
import './styles/App.css';

function App() {
  const cards = [
    {
        image: 'https://img.icons8.com/color/452/GeeksforGeeks.png',
        color: '#55ccff'
    },
    {
        image: 'https://img.icons8.com/color/452/GeeksforGeeks.png',
        color: '#e8e8e8'
    },
    {
        image: 'https://img.icons8.com/color/452/GeeksforGeeks.png',
        color: '#0a043c'
    },
    {
        image: 'https://img.icons8.com/color/452/GeeksforGeeks.png',
        color: 'black'
    }
];

  return (
    <div className='App'>
      {cards.map((card) => (
                <Card image={card.image} color={card.color} />
            ))}

    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/discover" element={<Discover />} />
        <Route path="/task-tracking" element={<TaskTracking />} />
        <Route path="/swipe-project" element={<SwipeProject />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/skill-development" element={<SkillDevelopment />} />
      </Routes>
    </Router>
    </div>
  );
}

export default App;
